import React, { Component } from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Jumbotron, Button, ButtonToolbar } from 'reactstrap';
import btwist from './btwist.MOV'


const NameHeader = (props) => {
  return (
    <div>
      <Jumbotron>
        <h1 className="display-3">Avery Wong</h1>
        <p className="lead">{"Hey guys this my personal website!"}</p>
        <hr className="my-2" />
        <p></p>
        <p className="lead">
        <ButtonToolbar>
          <Button variant="primary">Primary</Button>
          <Button variant="secondary">Secondary</Button>
          <Button variant="success">Success</Button>
          <Button variant="warning">Warning</Button>
          <Button variant="danger">Danger</Button>
          <Button variant="info">Info</Button>
          <Button variant="light">Light</Button>
          <Button variant="dark">Dark</Button>
          <Button variant="link">Link</Button>
         </ButtonToolbar>
        </p>
        <img width="400"  src={require('./profile.jpg')} />
      </Jumbotron>
    </div>
  );
};

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
        <NameHeader />
        <video width="1200"  id="background-video" className='videoTag' autoPlay loop muted>
         <source src={btwist} type='video/mp4' />
       </video>
        </header>
      </div>
    );
  }
}

export default App;
